import React from 'react';
import TextField from '@material-ui/core/TextField';
import InputLabel from '@material-ui/core/InputLabel';

const CreateGame = () => {

    return (
        <>
            <div id="contentcreate">
                <h1>cek</h1>
                <h1><span>Add Movie</span></h1 >
                <form style={{ margin: "20px", padding: "15px" }}>
                    <div>
                        <InputLabel style={{ float: "right", marginRight: "400px", color: "black", fontSize: "16px", fontWeight: 'bolder' }}>Year Release:</InputLabel>
                        <InputLabel style={{ marginLeft: "10px", color: "black", fontSize: "16px", fontWeight: 'bolder' }} >Game Title:</InputLabel>
                        <TextField
                            style={{ width: "400px", marginTop: '10px' }}
                            type="text"
                            id="outlined-secondary"
                            label="Game Title"
                            variant="outlined"
                            name="name"
                        // onChange={handleChange}
                        // value={input.title}

                        />

                        <TextField
                            style={{
                                marginLeft: "100px",
                                width: "400px", marginTop: '10px'
                            }}
                            type="number"
                            id="outlined-secondary"
                            label="Year"
                            variant="outlined"
                            name="year"
                            // onChange={handleChange}
                            // value={input.year}
                            inputProps={{ min: "1", step: "1" }}
                        />
                    </div>
                </form>
            </div>
        </>
    )
}
export default CreateGame;
